import React, { useRef, useState } from "react";
import { Button, Popover, OverlayTrigger, Overlay } from "react-bootstrap";
import "./Architecture.css";


// export default function HowItWorks() {  


export default function Example() {

  const popoverLeft = (
    <Popover id="popover-positioned-left" title="Popover left">
      <strong>Holy guacamole!</strong> Check this info.
    </Popover>
  );

  const myImage = () => ( 
    <div>
    <img class="image" src={require("./architecture3.png")}
    alt="App architecture" 
    height="562"
    weight="644"
    usemap="#image-map">
    </img>
    <map name="image-map">
      <area target="_self"  id="popover1" alt="1" title="1"  href="#" coords="133,58,20" shape="circle" />
    </map>
    </div>
  );


  return (

    <OverlayTrigger trigger="click" placement="right" overlay={popoverLeft}>
      <myImage />
    </OverlayTrigger>

  );
}

